import { Component, Input } from '@angular/core';
import {Car} from '../../Models/Car'

@Component({
  selector: 'app-car',
  templateUrl: './car.component.html',
  styleUrls: ['./car.component.scss']
})
export class CarComponent {
  @Input() car!: Car
}
<div class="img-div"></div>
<h1>{{car.type}}</h1>
<p>{{car.text}}</p>
<button>Saber más</button>
